    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE col0 NOT BETWEEN ( - col1 * + col0 + + col0 ) AND - col2 / - col2;
  - name: tab1

outputs:
  - name: q7519.out
    data: |
      3	26	54
      64	10	57
      80	13	96
